/*
 * @Description: 代理人信息
 * @Author: jian.weng
 * @Date: 2019-10-22 10:10
 */
import http from '@/public/http';
export const getAgentInfoListAPI = (args) =>{
    return http({
        url: '/users/queryListByAgentInfo',
        method: 'get',
        headers: {
            'token': localStorage.getItem('token')
        },
        params: args,
    });
 }
